import { Navbar, NavDropdown } from "react-bootstrap";
import { Container } from "react-bootstrap";
function Header() {
  return (
    <div>
      <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand>e-Commerce</Navbar.Brand>
        </Container>
      </Navbar>
    </div>
  );
}
export default Header;
